import React from 'react';
import './Form.css';
import TextField from '@mui/material/TextField';
import DateAdapter from '@mui/lab/AdapterMoment';

function Form() {
  return (
    <div>
      <h3>Form</h3>
      <TextField className='input' label='Symbol' variant='outlined' />
      <DateAdapter />
    </div>
  );
}

export default Form;
